  selector: 'app-root',
  template: `
  <main>
      <section class="content">
        <router-outlet></router-outlet>
      </section>
  </main>
  `,
  styleUrls: ['./app.component.css'],
})

export class AppComponent {
  title = 'vanya-angular';
}
